import { Container, Col } from "react-bootstrap"; 
import { useState, useEffect } from "react";
import axiosInstance from './api/axiosInstance';
import "./Tours.css";

const Tours = () => {   
    const [tours, setTours] = useState([]);
    const [seeTours, setSeeTours] = useState(false);

    useEffect(() => {   
        axiosInstance.get('/tours?limit=10&offset=0')
        .then(response => {
            setTours(response.data);
            console.log(response.data);
        })
        .catch(error => {
            console.error('There was an error!', error);
        });     
    }, []);

    return (
        <Container>
            <Col>Tours Component</Col>
            <Button onClick={()=>setSeeTours(!seeTours)}>{seeTours? 'See Tours':'Hide Tours'}</Button>
            {seeTours && 
                <Col>Here are the tours</Col>
            }
        </Container>
    );
}

export default Tours;
